scwin.lfn_Search = function() {

    wconv.clear(DsWs_Warning);

    //공통코드호출
    scwin.lfn_commCodeSetting("AddrFlag CrtorRelnCd RlnmCnfmRgcr AqamtChnlCd");

    //cbs - DsWs_Warning.DataObject = "DOBJ_AddrFlag";
    if (parent.sAgncYn != "Y") {
        //계약자코드 바인딩
        medt_sCrtorCd.setRef("data:Ds_LTIDA03.sCrtorCd");
    }

    cmb_sMailRvadAddrFlagCd.setRef("data:Ds_LTIDA03.sMailRvadAddrFlagCd");

	//cbs - insertRow -> Choose Option 사용
    //납입주기 선택옵션추가
//    var insRow = util.insertRow(DsWs_RlnmCnfmRgcr, 0);
//    DsWs_RlnmCnfmRgcr.setCellData(0, "sCd", "");
//    DsWs_RlnmCnfmRgcr.setCellData(0, "sHnglCdName", "- 선택 -");
    cmb_RlnmCnfmRgcr.setSelectedIndex(0);

	//cbs - insertRow -> Choose Option 사용
    //취득경로
//    var insRow = util.insertRow(DsWs_AqamtChnlCd, 0);
//    DsWs_AqamtChnlCd.setCellData(0, "sCd", "");
//    DsWs_AqamtChnlCd.setCellData(0, "sHnglCdName", "- 선택 -");
    cmb_AqamtChnlCd.setSelectedIndex(0);

    //계약자정보 복사
    Dsws_InsAmt.setJSON(parent.Dsws_InsAmt.getAllJSON());

    Ds_LTIDA03.setJSON(parent.Ds_LTIDA03.getAllJSON()); //계약자정보
    Ds_LTIDA03.setRowPosition(0, true);

    //비과세 정보 복사
    if (parent.DsWs_LTIDA51.getRowCount() > 0) {
        Ds_LTIDA51.setJSON(parent.DsWs_LTIDA51.getAllJSON()); //비과세 정보
    }
    sCrtorCd_Backup = Ds_LTIDA03.getCellData(0, "sCrtorCd"); //계약자코드Backup
    if (parent.sAgncYn == "Y") {
        Ds_CrtorCd.setCellData(0, "sCrtorCd", Ds_LTIDA03.getCellData(0, "sCrtorCd"));
    }

    //  Ds_LTIDA03.AddRow();
    //trace("계약자=="+parent.Ds_LTIDA03.SaveXML());  
    //만기수익자여부처리
    if (Ds_LTIDA03.getCellData(0, "sEnntmPftbpFlagCd").length > 0) {
        edt_sEnntmPftbpYn.setValue(Ds_LTIDA03.getCellData(0, "sEndPftbpName"));
    } else {
        edt_sEnntmPftbpYn.setValue("선택안됨");
    }

    //보험수익자여부처리
    /*
	if(Ds_LTIDA03.getColumn(0, "sInsurPftbpFlagCd").Length() > 0){
		edt_sInsurPftbpYn.Text = Ds_LTIDA03.GetColumn(0, "sInsurPftbpName");
	}else{

		edt_sInsurPftbpYn.Text = "선택안됨";
	}
	*/
    //지정대리인여부처리
    if (Ds_LTIDA03.getCellData(0, "sAsmtAgntFlagCd").length > 0) {
        edt_sAsmtAgntYn.setValue(Ds_LTIDA03.getCellData(0, "sAsmtAgntName"));
    } else {
        edt_sAsmtAgntYn.setValue("선택안됨");
    }


    //세금우대여부처리
    cmb_sTaxPrfrYn.setValue(parent.Ds_LTIDA00.getCellData(0, "sTaxPrfrYn"));
    if (cmb_sTaxPrfrYn.getValue() == "Y") {} else {
        cmb_sTaxPrfrYn.setValue("N");
    }


    //세금우대조회버튼 활성/비활성처리
    if (cmb_sTaxPrfrYn.getValue() == "Y" || cmb_sTaxPrfrYn.getValue() == "B") {
        btn_TaxSearch.setDisabled(false);
    } else {
        btn_TaxSearch.setDisabled(true);
    }


    //대상고객,취득경로
    if (parent.Ds_LTIDA00.getCellData(0, "sCrPrtrRole") != null && parent.Ds_LTIDA00.getCellData(0, "sCrPrtrRole") != "") {
        cmb_CrPrtrRole.setValue(parent.Ds_LTIDA00.getCellData(0, "sCrPrtrRole"));
    } else {
        cmb_CrPrtrRole.setValue("10");
        parent.util.insertColumn(parent.Ds_LTIDA00, [["sCrPrtrRole", "sCrPrtrRole", "text"]]);
        parent.util.setCompBindRefresh(parent.Ds_LTIDA00.getID());
        util.setRowPosition(parent.Ds_LTIDA00, 0);

        parent.Ds_LTIDA00.setCellData(0, "sCrPrtrRole", cmb_CrPrtrRole.getValue());
    }
    if (parent.Ds_LTIDA00.getCellData(0, "sAqamtChnlCd") != null) {
        cmb_AqamtChnlCd.setValue(parent.Ds_LTIDA00.getCellData(0, "sAqamtChnlCd"));
    }


    //2014.07.02 수정 By SDJ  (N1407-00007)
    //상품대상QA 확인하여 QA요청 활성화 or 승환계약일경우 QA심사
    if (parent.DsWs_PrdAttr.getCellData(0, "QAObjtYn") == "Y" || (wconv.toNumber(scwin.lfn_LapsCnclCrSearch(parent.Ds_Pibo.getCellData(0, "sInrpsCd"))) > 0 && parent.sScanObjtYn != "Y")) {
        if (parent.sScanObjtYn != "Y") {
            //비대면만 QA심사를 타도록 변경(N1404-00094)
            btn_QA.visible(true);
            btn_QA.setDisabled(true);
        } else {
            btn_QA.visible(false);
            btn_QA.setDisabled(true);
        }
        btn_Insu.setStyle("color", "black");
        edt_insu.setValue(parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankName"));

        //인수제한건 출력	
        edt_UdrtkLmitCnt.setValue(Ds_LTIDA15.getRowCount());
        if (Ds_LTIDA15.getRowCount() > 0) {
            btn_Insu.setDisabled(false);
            //btn_Insu.setStyle("color", "red");
            btn_Insu.changeClass(btn_Insu.getUserData("currClass"), "btn_nml red");
            btn_Insu.setUserData("currClass", "btn_nml red");
            //2015.06.02(N1506-00025) : 인수심사 완료후에도 인수심사요청 버튼 활성화
            btn_Simsa.setDisabled(false);
            sOnlySrarch = "1"; //END
        } else {
            btn_Insu.setDisabled(true);
            //btn_Insu.setStyle("color", "black");
            btn_Insu.changeClass(btn_Insu.getUserData("currClass"), "btn_nml");
            btn_Insu.setUserData("currClass", "btn_nml");
            btn_Simsa.setDisabled(true);
        }
        if (parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd") == "56" || parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd") == "45" || parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd") == "47") {
            // 56:인수승인,45:Qa대상, 47:Qa보완
            btn_QA.setDisabled(false);
            //2015.06.02(N1506-00025) : 인수심사 완료후에도 인수심사요청 버튼 활성화
            //btn_Simsa.Enable = false; 
            btn_Simsa.setDisabled(false);
            sOnlySrarch = "1"; //END
        } else if (parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd") == "49") {
            btn_QA.setDisabled(true);
            //2015.06.02(N1506-00025) : 인수심사 완료후에도 인수심사요청 버튼 활성화
            //btn_Simsa.Enable = false; 
            btn_Simsa.setDisabled(false);
            sOnlySrarch = "1"; //END
        } else if (wconv.substr(parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd"), 0, 1) == "4") {
            btn_QA.setDisabled(true);
            //2015.06.02(N1506-00025) : 인수심사 완료후에도 인수심사요청 버튼 활성화
            //btn_Simsa.Enable = false; 
            btn_Simsa.setDisabled(false);
            sOnlySrarch = "1"; //END
        } else if (parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd") == "51") {
            //51 심사대상일경우
            //인수요청버튼 활성화
            btn_Insu.setDisabled(false);
            btn_Simsa.setDisabled(false);
            sOnlySrarch = "";
        }
    } else {
        btn_QA.visible(false);
        //인수심사상태 출력
        if (wconv.substr(parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd"), 0, 1) == "5") {
            edt_insu.setValue(parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankName"));
            //인수제한건 출력	
            edt_UdrtkLmitCnt.setValue(Ds_LTIDA15.getRowCount());

            //51 심사대상일경우
            if (parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd") == "51") {
                //인수요청버튼 활성화
                btn_Insu.setDisabled(false);
                btn_Simsa.setDisabled(false);
                sOnlySrarch = "";
            } else {
                //btn_Simsa.Enable = false;
                btn_Simsa.setDisabled(false);
                sOnlySrarch = "1";
            }
        } else {
            btn_Insu.setDisabled(true);
            //2015.06.02(N1506-00025) : 인수심사 완료후에도 인수심사요청 버튼 활성화
            //btn_Simsa.Enable = false; 
            btn_Simsa.setDisabled(false);
            sOnlySrarch = "1"; //END
        }
    }
};

/*-----------------------------------
// function 명 : lfn_changeTrty
// 내용        : 피보험자의 해당 특약으로 필터링
-----------------------------------*/
scwin.lfn_changeTrty = function() {
    //Ds_Trty.FireEvent = false; //이벤트 발생이 안되도록 셋팅
    var nFindRow = wconv.findRow(Ds_Pibo, "sel", "1");

    Ds_Trty.removeColumnFilterAll();
    wconv.filter(Ds_Trty, "wconv.pos(chk, '1') >= 0 && wconv.pos(sScrnIndcYn, 'Y') >= 0 && nPsnPrprtGroupSeqno=='" + Ds_Pibo.getCellData(nFindRow, "nInrpsSeqno") + "'");

    //체크된 피보험자명 삽입
    Ds_Trty.setCellData(0, "sInrpsName", Ds_Pibo.getCellData(wconv.findRow(Ds_Pibo, "sel", "1"), "sInrpsName"));

    if ((parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2900") || 
    	(parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2901") || 
    	(parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2902") ||  // 2018 상품개정
    	(parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2120") ||
    	(parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2126") ||  // 2018 상품개정
    	(parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2122") || 
    	(parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2128")) {  // 2018 상품개정
        //trace("DsWs_TrtyTerm_"+nFindRow+":"+Object("DsWs_TrtyTerm_"+nFindRow).SaveXML());
//        grd_sTrty.SetCellProp("Body", 2, "ComboCol", "nInsurTermCd");
//        grd_sTrty.SetCellProp("Body", 2, "ComboDataset", "Ds_TrtyTerm_" + nFindRow);
        grd_sTrty.setColumnNodeSet("sInsurTermCd", "DsWs_TrtyTerm_"+nFindRow, "sInsurTermName", "nInsurTermCd");
    } else {
//        grd_sTrty.SetCellProp("Body", 2, "ComboCol", "sInsurTermCd");
//        grd_sTrty.SetCellProp("Body", 2, "ComboDataset", "DsWs_InusrTerm");
    	grd_sTrty.setColumnNodeSet("sInsurTermCd", "DsWs_TrtyTerm", "sInsurTermName", "nInsurTermCd");
    }

    //Ds_Trty.FireEvent = true; //이벤트 발생이 안되도록 셋팅
};

scwin.lfn_PiboLIst_OnCellClick = function(row,col) { 
	var pro = Promise.resolve();
	var colNm = grd_Pibo.getColumnID(col);

    switch (colNm) {
        case "sel":
            //현재 선택된 체크박스를 제외한 체크박스는 값을 0으로 바꾼다.
            for (var i = 0; i < Ds_Pibo.getRowCount(); i++) {
                if (row == i) {
                    Ds_Pibo.setCellData(i, "sel", "1");
                } else {
                    Ds_Pibo.setCellData(i, "sel", "0");
                }
            }
            scwin.lfn_changeTrty();
            break;
        case "sInrpsCd":
            var indata = { "sRow" : row };
            var pObj = { "Ds_LTIDA00" : parent.Ds_LTIDA00,
						 "Ds_Pibo" : Ds_Pibo
						} 
            pro = pro.then(function(rv) {
                //Ds_Pibo SEQ
                var popInfo = {
								"width"     : 1120,
								"height"    : 710,  
								"indata"    : indata,
								"title"     : "피보험자 누적",
								"parentObject" : pObj
							  };
				return wprom.popupOpen("/ui/cbsc/CBSC128P.xml", popInfo);
            });
            break;
        case "sRqstYnName":
        	var indata = {};
        	indata["sRqstYn"] = Ds_Pibo.getCellData(row, "sRqstYn");

            //고지사항입력여부
            /*if (Ds_LTIDA00.GetColumn(0, "sGdCd") == "2801"){
                	arg += " sDriveYn=" + quote("1");//운전구분	
                }else{
                	if(parent.Tab_Step1.DsWs_PrdAttr.GetColumn(0,"NotcGdFlag") == "01" || parent.Tab_Step1.DsWs_PrdAttr.GetColumn(0,"NotcGdFlag") == "02"){
                		arg += " sDriveYn="+quote("1");//운전구분
                	}else{
                		arg += " sDriveYn="+quote("0");//운전구분
                	}
                }*/
            if (wconv.length(parent.Tab_Step1.DsWs_PrdAttr.getCellData(0, "NotcGdFlag")) > 0) {
            	indata["sNotcGdFlag"] = parent.Tab_Step1.DsWs_PrdAttr.getCellData(0, "NotcGdFlag");
            } else {
            	indata["sNotcGdFlag"] = "00";	//고지상품구분(운전구분을 고지상품구분으로 대체)
            }
            indata["sInrpsCd"] = Ds_Pibo.getCellData(row, "sInrpsCd");
            //피보험자코드
            indata["sInrpsName"] = Ds_Pibo.getCellData(row, "sInrpsName");
            //성명
            indata["sCrtorRelnName"] = grd_Pibo.getCellDisplayData(row, "sCrtorRelnCd");
            //관계명
            indata["sPlanNo"] = parent.medt_PlanNo.getValue(); 
            //설계번호
            indata["sPsnGroupFlgcd"] = parent.Ds_LTIDA00.getCellData(0, "sPsnGroupFlgcd");
            //개인단체구분
            indata["nPsnGroupSeqno"] = Ds_Pibo.getCellData(row, "nInrpsSeqno");
            //seq
            indata["sSsrtDate"] = parent.Ds_LTIDA00.getCellData(0, "sSsrtDate"); 
            //청약일자
            indata["sDrveFlagCd"] = Ds_Pibo.getCellData(row, "sDrveFlagCd");
            //운전구분
            indata["sJobName"] = Ds_Pibo.getCellData(row, "sJobName");
            //운전구분
            indata["sGdCd"] = parent.Tab_Step1.DsWs_PrdAttr.getCellData(0, "GdCd");

            // 청약서 발행일자가 존재하면 조회만 가능
			if(wconv.length(parent.Ds_LTIDA00.getCellData(0,"sApplyPrtDate"))>0)
			{
				indata["sOnlySrarch"] = sOnlySrarch;
			}else{
				//arg += " sOnlySrarch="+quote(sOnlySrarch);
			}

            //상품코드 2014.11.25 By SDJ (N1408-00032) 간병보험 적용을 위해 추가
            //저축상품 여부
            var sSvtYn = "N";
            if (parent.DsWs_PrdAttr.getCellData(0, "GdFlgcd") == "2") {
