        if (wconv.length(Ds_Pibo.getCellData(i, "sApplPlanCd")) == 0) {
            sPlanCd = parent.Tab_Step1.cmb_Plan.getValue();
        } else {
            sPlanCd = Ds_Pibo.getCellData(i, "sApplPlanCd");
        }
        if (parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2900" || 
        	parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2901" || 
        	parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2902" ||	// 2018 상품 개정
        	(parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2121" && sPlanCd == "01") ||
        	(parent.Ds_LTIDA00.getCellData(0, "sGdCd") == "2127" && sPlanCd == "01")) {	// 2018 상품개정
            console.log("===고지입력제외");
