            }
        }
    }

    /*2014.07.02 인수심사와 QA심사 순서 바꾸면서 삭제함 By SDJ
     //QA여부 체크 
    if(parent.DsWs_PrdAttr.GetColumn(0,"QAObjtYn") == "Y"  &&
