//---------------------------------------------------------------------------
// function 명 : lfn_InrpsCd_display
// 내용        : 주민번호 "*"처리
//---------------------------------------------------------------------------
scwin.lfn_InrpsCd_display = function(sInrpsCd) {
	var rtnValue = sInrpsCd;
    if (parent.sAgncYn == "Y") {
    	rtnValue = sInrpsCd.substr(0,6) + "-" + sInrpsCd.substr(6,1) + "******";
        if (wconv.length(sInrpsCd) == 10) {
        	rtnValue = sInrpsCd.substr(0,3) + "-" + sInrpsCd.substr(3,2) + "******";
        }
        //grd_Pibo.SetCellProp("body", 1, "mask", "");
        //return gfn_convert_mask(sInrpsCd, smask);
        return rtnValue;
    } else {
    	rtnValue = sInrpsCd.substr(0,6) + "-" + sInrpsCd.substr(6,7);
        if (wconv.length(sInrpsCd) == 10) {
        	rtnValue = sInrpsCd.substr(0,3) + "-" + sInrpsCd.substr(3,2) + "-" + sInrpsCd.substr(5,5);
        }
    }
    return rtnValue;
};

